import React from "react";
import logo from "./logo.svg";
import { Menu, Row, Col, Input, Icon, Popover } from "antd";
import "./App.css";

function App() {
  const text = <span>Title</span>;
  const content = (
    <div>
      <p>Content</p>
      <p>Content</p>
    </div>
  );

  return (
    <div className="App">
      <div className="menuBar">
        <div className="logo">
          <a href="">Push Notification</a>
        </div>
        <div className="menuCon">
          <div className="rightMenu">
            <a href="">
              <Popover
                placement="rightBottom"
                title={text}
                content={content}
                trigger="click"
              >
                <Icon type="bell" spin />
              </Popover>
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
